              <div className="tl">
                <p className="f5-l f7 white  tracked-tight o-50 " >User Centre & Agile </p>
              </div>
              <div className="tr">
                <p className="f5-l f7 white tracked-tight o-50 "> <span>Design & </span><span>Strategy & </span><span>Tecnology & </span><span>Insight</span> </p>
              </div>

            </div>
        </div>

      </div>


);
}

